import React from 'react';

export default function NavBar() {
    return (
        <nav>
            <Link to='/news'>뉴스</Link>
            <Link to='/feed'>피드</Link>
            <Link to='/dictionary'>사전</Link>
            <Link to='/quiz'>퀴즈</Link>
            <Link to='/mypage'>마이페이지</Link>
        </nav>
    );
}
